import ReactDOM from "react-dom/client"
import "./fstyle.css"
import one from "./asserts/images/one.jpg"
import three from "./asserts/images/three.jpg"
import two from "./asserts/images/two.jpg"
import Navbar from "./components/Navbar"

const root=ReactDOM.createRoot(document.getElementById("root"))

//Navbar component  



//search Component


//Product components
function Product()
{
  return(
    <div class="products">

    <div class="box">

                <img src={one}></img>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
    </div>


    <div class="box">
        <img src={two} alt="villain"></img>
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
    </div>
    <div class="box">
        <img src={three} alt="Designs Club"></img>
        <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
    </div>



</div>
  )
}

//About component
function About()
{
  return(
    <div style={{textAlign:"center"}}>
    <div class="about" style={{marginTop: "10px", textAlign: "center"}}>
        <h1>About Us</h1>
