    </div>
    </div>
  )
}

function Footer()
{
  return(
   <footer>

            <div className="contact">




                <h3>Contact</h3>
                <p style={{marginTop:"5px"}}>+91 3478631928 <br></br>
                    perfumy@gmail.com
